Before proceeding, ensure you have the necessary permissions and follow Discord's guidelines regarding moderation actions.

Here's a simple example:

### Prerequisites:
- Node.js installed on your machine.
- You need to set up a Discord Developer Portal account to get your Bot Token and Client ID.

### Step-by-Step Code Example

1. **Create a new file named `index.js`**:
   ```javascript
   const { Client, GatewayIntentBits } = require('discord.js');
   const { REST } = require('@discordjs/rest');
   const { Routes } = require('discord-api-types/v9');

   const client = new Client({
     intents: [
       GatewayIntentBits.Guilds,
       GatewayIntentBits.GuildMessages,
       GatewayIntentBits.MessageContent,
       GatewayIntentBits.GuildMembers,
     ],
   });

   const commands = [];

   // Load your bot token
   const TOKEN = process.env.DISCORD_BOT_TOKEN;

   // Register the Slash Command
   registerCommands();

   async function registerCommands() {
     try {
       console.log('Registering commands...');
       const rest = new REST({ version: '9' }).setToken(TOKEN);

       const guildId = process.env.DISCORD_GUILD_ID; // Replace with your server's ID

       await rest.put(
         Routes.applicationGuildCommands(client.user.id, guildId),
         { body: commands },
       );

       console.log('Successfully registered application commands.');
     } catch (error) {
       console.error(error);
     }
   }

   // Slash Command Handler
   client.on('interactionCreate', async interaction => {
     if (!interaction.isCommand()) return;

     const { commandName } = interaction;
     if (commandName === 'ban') {
       const { members, args } = interaction;
       if (args.length < 2) {
         await interaction.reply('Please provide the user ID and reason.');
         return;
       }

       const targetUserId = args[0];
       const reason = args.slice(1).join(' ');

       if (!members.cache.has(targetUserId)) {
         await interaction.reply(`User ${targetUserId} not found.`);
         return;
       }

       const member = members.cache.get(targetUserId);
       if (!member.bannable) {
         await interaction.reply(`Unable to ban ${member.user.tag}.`);
         return;
       }

       await member.ban(reason);
       await interaction.reply(`Successfully banned ${member.user.tag} (${targetUserId}).`);
     }
   });

   client.login(TOKEN);
   ```

### Instructions:

1. **Create a `.env` File**: Add the following lines:
    ```plaintext
    DISCORD_BOT_TOKEN=<your-bot-token>
    DISCORD_GUILD_ID=<your-server-id>
    ```

2. **Install Dependencies**: Run the following command to install required packages:
    ```sh
    npm init -y
    npm install discord.js @discordjs/rest
    ```

3. **Run the Bot**: Execute the script using Node.js:
    ```sh
    node index.js
    ```

### Important Notes:
- **Permissions**: Ensure you have the appropriate permissions in your server to execute ban commands.
- **Moderation**: Use this responsibly and only when needed. Always inform users when banning them.
- **Security**: Never hard-code sensitive information like API tokens. Always use environment variables.

This setup ensures that your bot can handle slash commands effectively and safely manages moderation actions.

