First, you need to include the necessary headers and link against the `tinyxml2` library:

```sh
#include <iostream>
#include <string>
#include <tinyxml2.h>

// Function to convert Markdown to HTML
std::string markdownToHtml(const std::string& markdownText) {
    // Initialize TinyXML2 parser
    tinyxml2::XMLDocument doc;

    // Load Markdown text as XML
    doc.Parse(markdownText.c_str());

    // Create a new XML document for the output HTML
    tinyxml2::XMLDocument outDoc;
    tinyxml2::XMLElement* root = outDoc.NewElement("html");
    outDoc.InsertFirstChild(root);

    // Iterate through the parsed Markdown elements and add them to the HTML structure
    tinyxml2::XMLElement* element = root->FirstChildElement();
    while (element != nullptr) {
        if (element->Value() == "h1") {
            // Example: Convert header H1 to HTML
            tinyxml2::XMLElement* h1 = outDoc.NewElement("h1");
            h1->SetText(element->GetText());
            root->InsertEndChild(h1);
        } else if (element->Value() == "p") {
            // Example: Convert paragraph to HTML
            tinyxml2::XMLElement* p = outDoc.NewElement("p");
            p->SetText(element->GetText());
            root->InsertEndChild(p);
        }
        element = element->NextSiblingElement();
    }

    // Return the generated HTML as a string
    return outDoc.SaveHTML("");
}

int main() {
    std::string markdownText = R"(
# Hello, World!
This is a **bold** and *italicized* text.
)";

    std::string htmlText = markdownToHtml(markdownText);

    std::cout << "HTML:\n" << htmlText << "\n";

    return 0;
}
```

