#define SNAKE_H

#include <SDL.h>
#include "snake.c" // Include the implementation file

void init_game();
void update_game();
void render_game(SDL_Renderer* renderer);
void quit_game();

#endif
```

#### `snake.c`

```c
#include "snake.h"
#include <SDL.h>
#include <stdbool.h>

SDL_Window* window = NULL;
SDL_Renderer* renderer = NULL;

// Initialize SDL and create window
void init_game() {
    if (SDL_Init(SDL_INIT_VIDEO) < 0) {
        printf("SDL could not initialize! SDL_Error: %s\n", SDL_GetError());
        exit(1);
    }

    window = SDL_CreateWindow("Snake Game", SDL_WINDOWPOS_UNDEFINED, SDL_WINDOWPOS_UNDEFINED, 800, 600, SDL_WINDOW_SHOWN);
    if (window == NULL) {
