To determine whether a given integer `n` is a power of three, we can use a mathematical approach that avoids loops and recursion. This involves using logarithms to check if the logarithm base 3 of `n` is an integer.

Here's a Java solution that implements this logic:

```java
import java.lang.Math;

public class PowerOfThreeChecker {
    public static boolean isPowerOfThree(int n) {
        // A number is a power of three if log_3(n) is an integer.
        // We can check this by ensuring that 3 raised to the power of log_3(n) equals n.
        double logBase3OfN = Math.log(n) / Math.log(3);

        // If logBase3OfN is an integer, then n is a power of three.
        return logBase3OfN == Math.floor(logBase3OfN);
    }

    public static void main(String[] args) {
        int[] testNumbers = {27, 0, -1, 1, 9, 81, 15, 46, 343};
        for (int number : testNumbers) {
            System.out.println("Is " + number + " a power of three? " + isPowerOfThree(number));
        }
    }
}
```

### Explanation

1. **Math.log(n)**: Computes the natural logarithm of `n`.
2. **Math.log(n) / Math.log(3)**: Computes the logarithm base 3 of `n`. This gives us a value that should be close to an integer if `n` is a power of three.
3. **Math.floor(logBase3OfN)**: Rounds down the result to the nearest integer.
4. **logBase3OfN == Math.floor(logBase3OfN)**: Checks if the computed logarithm base 3 of `n` is an integer. If so, `n` is a power of three.

This method works well within the constraints provided (`-2^31 <= n <= 2^31 - 1`) because the logarithmic properties ensure accuracy.

### Follow-up Solution Without Loops/Recursion

For the follow-up question, if we want to solve it without loops or recursion, we can leverage a different mathematical property: The largest power of three less than \(2^{31}\) is \(3^{19} = 1162261467\).

We can check if `n` is a multiple of this largest power of three less than \(2^{31}\):

```java
import java.lang.Math;

public class PowerOfThreeCheckerNoLoops {
    public static boolean isPowerOfThree(int n) {
        // The largest power of three less than 2^31
        long largestPowerOfThree = (long) Math.pow(3, 19);

        // Check if n is greater than 0 and a multiple of the largest power of three less than 2^31
        return n > 0 && largestPowerOfThree % n == 0;
    }

    public static void main(String[] args) {
        int[] testNumbers = {27, 0, -1, 1, 9, 81, 15, 46, 343};
        for (int number : testNumbers) {
            System.out.println("Is " + number + " a power of three? " + isPowerOfThree(number));
        }
    }
}
```

### Explanation

1. **largestPowerOfThree**: Computes the largest power of three less than \(2^{31}\), which is \(3^{19} = 1162261467\).
2. **Check condition**: Ensures that `n` is positive and divisible by `largestPowerOfThree`.

This method avoids loops and recursion by leveraging the precomputed maximum value.

