```java
import java.math.BigDecimal;
import java.math.RoundingMode;

public class PowerOfThree {
    public static boolean isPowerOfThree(int n) {
        // Check if n is less than or equal to 0
        if (n <= 0) {
            return false;
        }

        // Calculate the logarithm base 3 of n
        BigDecimal logBase3 = BigDecimal.valueOf(Math.log(n) / Math.log(3));

        // Rounding the result to see if it is an integer
        BigDecimal roundedResult = logBase3.setScale(0, RoundingMode.HALF_UP);

        // Check if the rounded result is an integer
        return roundedResult.compareTo(BigDecimal.ONE) == 0;
    }

    public static void main(String[] args) {
        System.out.println(isPowerOfThree(27)); // Output: true
        System.out.println(isPowerOfThree(0));  // Output: false
        System.out.println(isPowerOfThree(-1)); // Output: false
    }
}
```

### Explanation:
1. **Check for Non-positive Numbers**: If `n` is less than or equal to zero, it cannot be a power of three, so we return `false`.
2. **Calculate Logarithm Base 3**: We use the formula `Math.log(n) / Math.log(3)` to compute the logarithm base 3 of `n`. This gives us a decimal value which might not be exactly an integer due to floating-point precision.
3. **Rounding the Result**: We round the result using `BigDecimal` to ensure accurate rounding and then compare the rounded value to `1` to check if it is an integer.

This approach ensures that we avoid using loops or recursion while still correctly identifying whether `n` is a power of three. 

Note: This method works well within the constraints given (i.e., `-2^31 <= n <= 2^31 - 1`). The use of `BigDecimal` helps manage potential precision issues with floating-point arithmetic.

