        while (index != std::string::npos) {
            count++;
            index = line.find(searchWord, index + 1); // Search after found occurrence
        }
    }

    // Close the file
    file.close();

    // Output the total count of the word
    std::cout << "The word '" << searchWord << "' occurs " << count << " times in the file." << std::endl;

    return 0;
}
```

### Explanation:
- **File Handling**: The program uses an `ifstream` object to read the contents of the file line by line.
- **Search Word**: The `find` function is used to locate occurrences of the word within each line.
- **Loop Through Lines**: A loop goes through each line and checks for the presence of the word using the `find` method. The `find` method returns the starting index of the first occurrence of the substring, or `std::string::npos` if the substring is not found.
- **Count Occurrences**: If the word is found, the count is incremented, and the search continues from the next character after the found occurrence.
- **Closing the File**: After processing all lines, the file is closed to free up resources.

This program ensures that only valid files are processed and provides appropriate feedback when there are issues with file access.
